import React, { useState, useEffect } from "react";

import Card from "../UI/Card/Card";
import classes from "./MyMountains.module.css";

const MyMountains = () => {
  useEffect(() => {
    const fetchMyMountains = async () => {
      try {
        const response = await fetch("http://localhost:8080/getallmountains");
        if (!response.ok) {
          throw new Error("Something went wrong");
        }
        // let body = JSON.parse(JSON.stringify(response));
        const body = await response.json();
        setAllMountains(body);
      } catch (error) {
        console.log(error.message);
      }
    };
    fetchMyMountains();
  }, []);

  return (
    <Card className={classes.mountainsinfo}>
      <h1>My mountains</h1>
    </Card>
  );
};

export default MyMountains;
